    t[364] = "When a new service tunnel is created, or a service is run for the first time (e.g. the default jetty webserver, plugins), a private encryption key is created which essentially controls the ownership of address. This is usually named <code>&hellip;privKey.dat</code>, or <code>eepPriv.dat</code>, though it's a good idea to change the name to indicate the service it belongs to and then respecify it in the Tunnel Manager server settings. This .dat file should be backed up safely; lose it and you will lose ownership and control of your hostname!";
    t[365] = "Ko se ustvari nov tunel storitve, ali ko se storitev prvi\u010d izvede (npr. privzeti stre\u017enik spletne strani jetty, vstavki), se ustvari zasebni \u0161ifrirni klju\u010d, ki podstatno nadzira lastni\u0161tvo naslova. Ta je obi\u010dajno imenovan <code>&hellip;privKey.dat</code>, ali <code>eepPriv.dat</code>, vendar je dobro ideja spremeniti ime, da ukazuje na storitev, ki ji pripada, in nato to ponovno dolo\u010diti v nastavitvah stre\u017enika Mened\u017eer tunela. Ta .dat datoteko je treba varno narediti varnostno kopijo; izgubite ga in izgubite lastni\u0161tvo in nadzor nad svojim imenom gostitelja!";
    t[368] = "This setting allows configuration of the maximum number of files per torrent I2PSnark will permit, when downloading or creating a torrent. Note that substantially increasing this value from the default of 2000 files may require additional configuration on the host system to increase the maximum number of open files the operating system will permit (e.g. <code>ulimit -n</code> on Linux). To change, add to I2PSnark's configuration file <code>i2psnark.config</code>. [Restart of I2PSnark or router required]";
    t[369] = "Ta nastavitev omogo\u010da konfiguracijo maksimalnega \u0161tevila datotek na torrent, ki ga bo dovolil I2PSnark, ko prena\u0161a ali ustvari torrent. Opomba: zna\u010dajno pove\u010danje vrednosti iz privzeta 2000 datotek morda zahteva dodatno konfiguracijo na gostiteljskem sistemu, da pove\u010da maksimalno \u0161tevilo odprtyh datotek, ki jih operacijski sistem dovoli (npr. <code>ulimit -n</code> na Linuxu). Da spremeni\u0161, dodaj v konfiguracijsko datoteko I2PSnark <code>i2psnark.config</code>. [Ponovni zagon I2PSnark ali usmerjevalnika zahtoven]";
