    t[620] = "While I2P will work fine in this configuration, if you really have over 128KBps of bandwidth to share, it will be much more helpful to the network if you open your firewall.";
    t[621] = "\u010ceprav bo I2P v tej konfiguraciji deloval dobro, \u010de res imate ve\u010d kot 128KBps \u0161irine pasma za deljenje, bo omre\u017eju bolj pomembno, \u010de odprite svoj omejitelj.";
    t[622] = "A command-line application supplied with I2P that is used to request URL resources, similar to <a href=https://www.gnu.org/software/wget/ class='sitelink external' target=_blank rel=noreferrer>wget</a> or <a href=https://curl.haxx.se/ class='sitelink external' target=_blank rel=noreferrer>curl</a>. Eepget is also used internally by the router, for example to reseed from remote hosts. By default, eepget uses the HTTP proxy on <code>127.0.0.1:4444</code>.";
    t[623] = "Naredilna vrstica aplikacija, ki jo ponuja I2P, in ki se uporablja za zahteve URL virov, podobno kot <a href=https://www.gnu.org/software/wget/ class='sitelink external' target=_blank rel=noreferrer>wget</a> ali <a href=https://curl.haxx.se/ class='sitelink external' target=_blank rel=noreferrer>curl</a>. Eepget se tudi uporablja notranje s strani usmerjevalnika, na primer za ponovno zalaganje iz oddaljenih gostiteljev. Po privzemu, uporablja eepget HTTP posredni\u0161ki stre\u017enik na <code>127.0.0.1:4444</code>.";
