    t[723] = "Javadocs";
    t[724] = "An eepsite is a website that is hosted anonymously on the I2P network - you can access it by configuring your web browser to use I2P's HTTP proxy (see above) and browsing to the <code>.i2p</code> suffixed website (e.g. <a href=http://i2p-projekt.i2p/ target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p</a>). Also ensure your browser is configured to resolve DNS remotely when using the proxy to avoid DNS leaks.";
    t[725] = "Eepsite je spletna stran, ki je anonimno gostiteljstvo na omre\u017eju I2P - lahko jo dostopate, tako da konfigurirate svoj spletni brskalnik, da uporabi HTTP proxy I2P (glejte zgoraj) in obi\u0161\u010dete spletno stran z kon\u010dnico <code>.i2p</code> (npr. <a href=http://i2p-projekt.i2p/ target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p</a>). Prav tako se prepri\u010dajte, da je va\u0161 brskalnik konfiguriran tako, da re\u0161i DNS zdaljeno, ko uporabljate posredni\u0161ki stre\u017enik, da prepre\u010dite presko\u010dke DNS.";
