    t[836] = "The first number is the number of peers your router has sent or received a message from in the last few minutes. This may range from 8-10 to several hundred, depending on your total bandwidth, shared bandwidth, and locally-generated traffic. The second number is the number of peers seen in the last hour or so. Do not be concerned if these numbers vary widely. <a href='/configstats#router.activePeers'>[Enable graphing]</a>.";
    t[837] = "Prva \u0161tevilka je \u0161tevilo sosednjih stre\u017enikov, s katerimi je va\u0161 stre\u017enik v zadnjih nekaj minutah poslal ali prejel sporo\u010dilo. To lahko sega od 8-10 do nekaj sto, glede na va\u0161o skupno \u0161irino pasma, deljeno \u0161irino pasma, in lokalno ustvarjeno promet. Druga \u0161tevilka je \u0161tevilo sosednjih stre\u017enikov, videnih v zadnjem uri ali tako. \u010ce ta \u0161tevilka razlikuje v veliki meri, se ne skrbi. <a href='/configstats#router.activePeers'>[Omogo\u010di grafe]</a>.";
