    t[1212] = "The skew (offset) of your computer's clock relative to the network-synced time (if known). I2P requires your computer's time be accurate. If the skew is more than a few seconds, please correct the problem by adjusting your computer's time. If I2P cannot connect to the internet, a reading of 0ms may be indicated. Note: This is only displayed in the <i>Router Information (advanced)</i> section. You may add this section to your Sidebar on the <a href='/configsidebar'>Sidebar Configuration page</a>.";
    t[1213] = "Premik (premak) uro va\u0161ega ra\u010dunalnika v odnosu do omre\u017eja-sinhronizirane \u010das (\u010de je znano). I2P zahteva, da je \u010das va\u0161ega ra\u010dunalnika natan\u010den. \u010ce je premik ve\u010d kot nekaj sekund, prosimo, da to popravite, tako da prilagodite \u010das va\u0161ega ra\u010dunalnika. \u010ce I2P ne more povezati z interneto, se lahko prika\u017ee branje 0ms. Opomba: To se prika\u017ee samo v sekciji <i>Informacije o stre\u017eniku (napredne)</i>. To lahko dodate v svojo vrstnico na <a href='/configsidebar'>strani za konfiguracijo vrstnice</a>.";
