    t[2206] = "Version";
    t[2207] = "Razli\u010dica";
    t[2210] = "I2P selects a random port between 9000 and 31000 to communicate with other routers when the program is run for the first time, or when your external IP address changes when running in <a href=/confignet#ipchange>Laptop Mode</a>. The <a href=/confignet#udpconfig>selected port</a> is shown on the <a href=/confignet>Network Configuration page</a>.";
    t[2211] = "I2P izbere naklju\u010dno vrata med 9000 in 31000 za komunikacijo z drugimi usmerjevalniki, ko se programa prvi\u010d zagni, ali ko se spremeni va\u0161 zunanji IP naslov ob delovanju v <a href=/confignet#ipchange>Na\u010din prijenosnega ra\u010dunalnika</a>. <a href=/confignet#udpconfig>Izbrane vrata</a> so prikazane na <a href=/confignet>Strani za konfiguracijo omre\u017eja</a>.";
    t[2212] = "Message send rate (B/s)";
