    t[2236] = "midnight";
    t[2237] = "polno\u010d";
    t[2246] = "A gentle introduction to I2P";
    t[2247] = "Mekan uvod v I2P";
    t[2250] = "How long jobs are waiting before execution. The job queue is listed on the <a href='/jobs'>Jobs page</a>. Unfortunately, there are several other job queues in the router that may be congested, and their status is not available in the router console. The job lag should generally be zero. If it is consistently higher than 500ms, your computer is very slow, your network is experiencing connectivity issues, or the router has serious problems. <a href='/configstats#jobQueue.jobLag'>[Enable graphing]</a>.";
    t[2251] = "Kako dolgo \u010dakajo naloge pred izvedbo. Red nalog je naveden na <a href='/jobs'>strani za naloge</a>. Na \u017ealost, obstajajo \u0161tevilni drugi redi nalog v stre\u017eniku, ki morda so prenatljeni, in njihov status ni na voljo v konzoli stre\u017enika. Zamik naloga bi moral biti obi\u010dajno ni\u010d. \u010ce je to skladno vi\u0161je od 500ms, je va\u0161 ra\u010dunalnik zelo po\u010dasen, va\u0161e omre\u017eje do\u017eivlja te\u017eave z povezavo, ali pa ima stre\u017enik ozbiljne te\u017eave. <a href='/configstats#jobQueue.jobLag'>[Omogo\u010di grafe]</a>.";
    t[2252] = "Configure I2P Updates";
    t[2253] = "Nastavi posodobljanja I2P";
    t[2254] = "Before you tell the world about your new website, you should add some content. Go to the server's root directory <a href=#rootdir>listed above</a> and replace the <i>index.html</i> redirect page with your own content. If you need a template for a basic site, feel free to adapt <a href=http://127.0.0.1:7658/help/pagetemplate.html>this page</a>. If you're returned to this page after editing the content, try clearing your browser's web cache.";
    t[2255] = "Preden obvestite svet o svoji novi spletni strani, morate dodati nekaj vsebine. Pojdite v koreni mapi stre\u017enika <a href=#rootdir>navedene zgoraj</a> in nadome\u0161\u010dajte stran preusmeritve <i>index.html</i> z svojo vsebino. \u010ce potrebujete predlogo za osnovno mesto, se sprostite prilagoditi <a href=http://127.0.0.1:7658/help/pagetemplate.html>to stran</a>. \u010ce se po ureditvi vsebine vrnete na to stran, poskusite izbrisati predpomnilnik spletnega brskalnika.";
