    t[2294] = "The <i class=example>default</i> threshold applies to any remote destination not explicitly listed in the definition or in any of the referenced files. To set a default threshold use the keyword <i class=example>default</i>.";
    t[2295] = "Privzeti prag <i class=example>default</i> se uporablja za vse daljanske destinacije, ki niso izrecno navedene v definiciji ali v kateri koli od omenjenih datotek. Za nastavitev privzetega praga uporabite klju\u010dno besedo <i class=example>default</i>.";
