    t[2311] = "Po\u0161lji na";
    t[2312] = "If your router has 10 or more active peers, everything is fine. The router should maintain connections to a few peers at all times. The best way to stay \"better-connected\" to the network is to <a href=/config>share more bandwidth</a>.";
    t[2313] = "\u010ce ima va\u0161 usmerjevalnik 10 ali ve\u010d aktivnih partnerjev, je vse v redu. Usmerjevalnik mora vedno vzdr\u017eevati povezave z nekaj partnerji. Najbolj\u0161i na\u010din, da ostane \"bolje povezan\" z omre\u017ejem, je <a href=/config>deliti ve\u010d \u0161irine pasma</a>.";
