    t[2364] = "Some basic indications of router overload:";
    t[2365] = "Nekatere osnovne ukazila preoptere\u010ditve stre\u017enika:";
    t[2370] = "Glossary";
    t[2371] = "Razlo\u010dilo";
    t[2376] = "To obtain your own hostname, I2P domain registrars such as <a href=http://stats.i2p/i2p/addkey.html target=_blank rel=noreferrer class=sitelink>stats.i2p</a> or <a href=http://reg.i2p/ target=_blank rel=noreferrer class=sitelink>reg.i2p</a> provide registration services that allow you to register and manage an .i2p hostname or sub-domain which will then be propagated across the network. Some registration sites will require the <i>B64 destination address</i> for the tunnel/service you wish to associate with a hostname, which you should copy from the <i>Local destination</i> section on the <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>.";
    t[2377] = "Da bi pridobil svoje ime gostitelja, registrirski centri I2P, kot so <a href=http://stats.i2p/i2p/addkey.html target=_blank rel=noreferrer class=sitelink>stats.i2p</a> ali <a href=http://reg.i2p/ target=_blank rel=noreferrer class=sitelink>reg.i2p</a>, ponujajo registracijske storitve, ki omogo\u010dajo registracijo in upravljanje imena gostitelja ali poddomene .i2p, ki se nato \u0161iri po omre\u017eju. Nekatera mesta za registracijo bodo zahtevala <i>destinacijski naslov B64</i> za tunel ali storitev, ki jo \u017eelite povezati z imenom gostitelja, ki ga morate kopirati iz sekcije <i>Lokalna destinacija</i> na strani <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Nastavitve mened\u017eera tunela</a>.";
