    t[2482] = "This indicates the amount of RAM I2P is using, and the total amount available, allocated by Java. If the usage is consistently high relative to the available RAM, this may indicate that you need to increase the ram allocated to the JVM. You can allocate more RAM by editing your <code>wrapper.config</code> file which is normally located in the I2P application directory. You will need to edit the <code>wrapper.java.maxmemory</code> parameter, which by default is set to 256(MB) for I2P, or 384 for I2P+. Note: if the memory bar is enabled, the memory entry in the router info section will be suppressed.";
    t[2483] = "To ka\u017ee, koliko RAM-a I2P uporablja, in celotno koli\u010dino, dodeljeno Java. \u010ce je uporaba natan\u010dno visoka v odnosu do na voljo RAM-a, to lahko ka\u017ee, da potrebujete ve\u010d RAM-a dodeliti JVM. Ve\u010d RAM-a lahko dodelite tako, da urejate svojo <code>wrapper.config</code> datoteko, ki je obi\u010dajno razpola\u017eljiva v direktoriju aplikacije I2P. Boste morali urediti parameter <code>wrapper.java.maxmemory</code>, ki je privzeto nastavljen na 256(MB) za I2P, ali 384 za I2P+. Opomba: \u010de je vrstica za pomnilnik omogo\u010dena, vnos pomnilnika v sekciji informacije o stre\u017eniku bo zmanj\u0161an.";
