    t[2578] = "Many of the stats on the sidebar may be <a href='/configstats'>configured</a> to be <a href='/graphs'>graphed</a> for further analysis. You may also customize the sections that appear on the Sidebar and their positioning on the <a href='/configsidebar'>Sidebar Configuration page</a>.";
    t[2579] = "Mnoge statistike na vrstnici lahko nastavite, da jih <a href='/configstats'>nastavite</a> za <a href='/graphs'>grafike</a> za daljnjo analizo. Tudi lahko prilagodite sekcije, ki se pojavejo na vrstnici, in njihovo polo\u017eaj na <a href='/configsidebar'>strani za nastavitev vrstnice</a>.";
    t[2582] = "This tunnel-specific setting allows you to enable or disable replies to pings sent to servers hosted by the router. To disable pings, you must add the line <code>i2p.streaming.answerPings=false</code> to the <i>Custom Options</i> section for the server's configuration in the Tunnel Manager.";
    t[2583] = "Ta nastavitev specifi\u010dna za tunel vam omogo\u010da omogo\u010danje ali onemogo\u010danje odgovorov na pings, poslane na stre\u017enike gostiteljene s strani usmerjevalnika. Da onemogo\u010dite pings, morate dodati vrstico <code>i2p.streaming.answerPings=false</code> v sekcijo <i>Prilagojene mo\u017enosti</i> za konfiguracijo stre\u017enika v Mened\u017eer tunela.";
    t[2592] = "Max";
