    t[2617] = "\u010ce poznavate in zaupate nekomu, ki pokrene I2P, vpra\u0161ajte jih, da vam po\u0161ljejo datoteko ponovnega zalaganja, ustvarjeno z uporabo te strani v njihovi konzoli stre\u017enika. Nato izberite mo\u017enost <i>Ponovno zalaganje iz datoteke</i> na {0} z uporabo prejete datoteke.";
