    t[2696] = "This setting (in seconds) allows you to override the delay between runs of the Peer Exploration Job which attempts to locate new peers to add to the NetDb. The job will run every 80 seconds by default, or if the router is experiencing job or message lag, every 3 minutes. If the size of the NetDb reaches 4000 peers, the pause will increase to 15 minutes. You may wish to increase the delay if your NetDb is well-populated (over 2000 peers), or if you wish to reduce overall bandwidth usage. Note: For Floodfill routers, this job does not run.";
    t[2697] = "Ta nastavitev (v sekundah) vam omogo\u010da nadomestiti zamik med poskusami delo Peer Exploration, ki posku\u0161a najti nove sosednje stre\u017enike za dodajanje v NetDb. Delo se bo izvedlo vsake 80 sekund po privzemu, ali pa, \u010de usmerjevalnik do\u017eivlja zamik nalog ali sporo\u010dil, vsake 3 minute. \u010ce je velikost NetDb dosegle 4000 sosednjih stre\u017enikov, po\u010ditnice se bo pove\u010dala na 15 minut. Morda bi \u017eeleli pove\u010dati zamik, \u010de je va\u0161 NetDb dobro naseljen (ve\u010d kot 2000 sosednjih stre\u017enikov), ali pa \u010de \u017eelite zmanj\u0161ati skupno uporabo \u0161irine pasma. Opomba: Za usmerjevalnike Floodfill, to delo ne deluje.";
    t[2698] = "Current";
    t[2699] = "Trenutno";
    t[2720] = "A website hosted on the I2P network. By default, a <a href=https://www.eclipse.org/jetty/about.html class='sitelink external' target=_blank rel=noreferrer>Jetty webserver</a> is configured and running on <a href=http://127.0.0.1:7658/ target=_blank rel=noreferrer>http://127.0.0.1:7658/</a>.";
    t[2721] = "Spletna stran gostiteljena na omre\u017eju I2P. Po privzemu, <a href=https://www.eclipse.org/jetty/about.html class='sitelink external' target=_blank rel=noreferrer>Jetty spletne stre\u017enik</a> je konfiguriran in deluje na <a href=http://127.0.0.1:7658/ target=_blank rel=noreferrer>http://127.0.0.1:7658/</a>.";
    t[2722] = "Can be disabled or changed in the <a href=/i2ptunnelmgr>Tunnel Manager</a>. Can also be configured to bind to a specific interface or all interfaces.";
    t[2723] = "Lahko se onemogo\u010di ali spremeni v <a href=/i2ptunnelmgr>Upravitelj tuneljev</a>. Prav tako je mogo\u010de konfigurirati, da se pove\u017ee na dolo\u010den vmesnik ali vse vmesnike.";
    t[2728] = "I2P+ Service now enabled on system start";
