    t[2753] = "Isti IP kot mi";
    t[2754] = "You may create a new router family here. Once you have created the family, you may export the family key file and share with other routers in your nominated family.";
    t[2755] = "Tukaj lahko ustvarite novo dru\u017eino usmerjevalnika. Ko boste ustvarili dru\u017eino, lahko izve\u017eete dru\u017einski klju\u010dni datoteko in jo delite z drugimi usmerjevalniki v svoji nominirani dru\u017eini.";
    t[2756] = "Tunnels peer has agreed to participate in";
    t[2757] = "Tuneli, v katerih se je parter strinjal sodelovati";
    t[2758] = "Advanced Lookup";
    t[2759] = "Napredno iskanje";
    t[2766] = "In order to access websites hosted on I2P, and optionally use the default outproxy to connect to websites on clearnet, you will need to configure your browser to use the I2P HTTP proxy, by default running on <code>127.0.0.1 port 4444</code>. Most browsers offer an option to configure your proxy; in this mini-tutorial we'll focus on Firefox.";
    t[2767] = "Da bi dostopali do spletnih strani, gostiteljstvo na I2P, in pri \u017eelji uporabljali privzeti izhodni proxy za povezavo s spletnimi stranmi na clearnet, boste morali konfigurirati brskalnik, da uporabi HTTP proxy I2P, ki privzeto te\u010de na <code>127.0.0.1 vrata 4444</code>. Ve\u010dina brskalnikov ponuja mo\u017enost za konfiguriranje va\u0161ega posredni\u0161kega stre\u017enika; v tem mini-tutoriju se bomo usmerili na Firefox.";
    t[2776] = "Close to us";
    t[2777] = "Blizu nas";
    t[2790] = "I2P+ Router Sitemap";
    t[2791] = "Spletne mape usmerjevalnika I2P+";
    t[2794] = "Downloaded plugin version {0} is not newer than installed plugin";
    t[2795] = "Razli\u010dica prenesenega vstavka {0} ni novej\u0161a kot name\u0161\u010deni vstavek";
    t[2796] = "Streaming radio service";
    t[2797] = "Streaming storitev radija";
    t[2798] = "I2P+ functions best when you can accurately reflect the speed of your network connection in the <a href=/config>bandwidth configuration section</a>. By default I2P+ is configured with some fairly conservative values that will not suit many use cases, so please take time to review these settings and correct where necessary. The more bandwidth you allocate, <i>specifically</i> upstream bandwidth, the more you will benefit from the network.";
    t[2799] = "I2P+ deluje najbolje, ko lahko to\u010dno odbija hitrost va\u0161e omre\u017ene povezave v <a href=/config>sekciji konfiguracije \u0161irine pasma</a>. Po privzemu je I2P+ konfiguriran z nekaterimi zelo varnostnimi vrednostmi, ki ne bodo ustrezale mnogim primerom uporabe, zato prosimo, da se vzamete \u010das, da preverite te nastavitve in jih pravilno nastavite, kjer je potrebno. Ve\u010djo \u0161irino pasma, <i>osebno</i> gorejo\u010do \u0161irino pasma, dodelite, ve\u010d boste koristili od omre\u017eja.";
    t[2810] = "Transit by Peer";
