    t[2815] = "Vstavek zahteva razli\u010dico Jetty {0} ali ni\u017ejo";
    t[2822] = "The proxy may be remotely hosted or a service running on your computer (localhost/127.0.0.1).";
    t[2823] = "Posredni\u0161ki stre\u017enik je lahko gostilen oddaljeno ali pa je storitev, ki se izvaja na va\u0161em ra\u010dunalniku (localhost/127.0.0.1).";
