    t[2844] = "What to do in the event I2P+ isn't working";
    t[2845] = "Kaj storiti, \u010de I2P+ ne deluje";
    t[2856] = "ANONYMITY WARNING - Settings include 1-hop tunnels.";
    t[2857] = "OPOMBA O ANONIMNOSTI - Nastavitve vklju\u010dujejo 1-skokov tunele.";
    t[2858] = "I2P IRC Network";
    t[2859] = "Omre\u017eje IRC I2P";
    t[2864] = "pixels wide";
    t[2865] = "pikslov \u0161iroko";
    t[2882] = "The I2P Network Protocol (I2NP) manages the routing and mixing of messages between routers, in addition to the transport selection (where more than one is supported) when communicating with a peer. For more information, see the <a href=https://geti2p.net/en/docs/protocol/i2np class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[2883] = "Protokol omre\u017eja I2P (I2NP) upravlja usmerjanjem in me\u0161anjem sporo\u010dil med usmerjevalniki, poleg izbora prevoza (kjer je podprto ve\u010d kot en) pri komunikaciji s sosednjim stre\u017enikom. Za ve\u010d informacij, glejte <a href=https://geti2p.net/en/docs/protocol/i2np class='sitelink external' target=_blank rel=noreferrer>spletna dokumentacija</a>.";
    t[2884] = "Expired {0} ago";
    t[2885] = "Isteklo {0} pred tem";
    t[2892] = "Your router's status on accepting or rejecting requests from other routers to build a participating tunnel through your router. Your router may accept all requests, accept or reject a percentage of requests, or reject all requests for a number of reasons, to control the bandwidth and CPU demands and maintain capacity for local clients. <b>Note";
    t[2893] = "Stanje va\u0161ega stre\u017enika glede sprejemanja ali zavrnitve zahteve od drugih stre\u017enikov za izgradnjo sodelujucega tunela skozi va\u0161 stre\u017enik. Va\u0161 stre\u017enik morda sprejme vse zahteve, sprejme ali zavrne del zahteve, ali zavrne vse zahteve zaradi \u0161tevilnih razlogov, da kontrolira \u0161irino pasma in zahteve za CPU in vzdr\u017euje zmogljivost za lokalne kliente. <b>Opomba";
    t[2902] = "Please contact a known trustworthy friend who has a running I2P router, and ask them for help with reseeding your I2P router. Request that they send you a reseed file exported from their running I2P router. It is vital that the file is exchanged over a secure channel, e.g. encrypted to avoid external tampering (PGP Sign, Encrypt and Verified with a trusted public key). The file itself is unsigned, so please accept files only from known trusted friends. Never import a reseed file if you cannot verify its source.";
    t[2903] = "Prosimo, da se obrnete na znana pouzdna prijatelja, ki ima pokremljen stre\u017enik I2P, in vpra\u0161ajte jih za pomo\u010d pri ponovnem zalaganju va\u0161ega stre\u017enika I2P. Zahtevajte, da vam po\u0161ljejo datoteko ponovnega zalaganja, izvo\u017eeno iz njihovega pokremljenega stre\u017enika I2P. Klju\u010dno je, da je datoteka izmenjavljena preko varnega kanala, npr. \u0161ifrirana, da se izognemo zunanjemu vmetanju (PGP Podpi\u0161i, \u0160ifriraj in Preveri z pouzdanjo javno klju\u010dem). Sama datoteka ni podpisana, zato sprejemajte datoteke le od znanih pouzdanih prijateljev. Nekaj ne uvozi datoteke ponovnega zalaganja, \u010de ne morete preveriti njenega virja.";
    t[2916] = "Last Good Send";
    t[2917] = "Zadnje dobro po\u0161iljanje";
    t[2918] = "Delete this value to disable";
    t[2919] = "Izbri\u0161i to vrednost, da onemogo\u010di\u0161";
    t[2920] = "You can use a recorder in one tunnel that writes to a file that another tunnel, or multiple tunnels, can use for throttling. These files can also be edited by hand.";
    t[2921] = "Uporabiti lahko zapisovalca v enem tunelu, ki zapi\u0161e v datoteko, ki jo lahko drugi tunel ali ve\u010d tunelov uporabljajo za omejevanje. Te datoteke lahko tudi ro\u010dno urejate.";
    t[2924] = "Router running a non-native, software emulated version of the Java BigInteger library";
    t[2925] = "Usmerjevalnik delajo neautohtona, verzija programske opreme Java BigInteger knji\u017enice";
