    t[2935] = "Skosen \u010dasovnik partnerja glede na na\u0161 \u010dasovnik";
    t[2936] = "A threshold that if breached will cause the offending remote destination to be recorded in a specified file";
    t[2937] = "Prag, ki, \u010de je kr\u0161en, povzro\u010di, da se kr\u0161ljiv daljanski namen zapise v dolo\u010deno datoteko";
    t[2938] = "This is usually due to a port 7654 conflict. Check the logs to verify.";
    t[2939] = "To je obi\u010dajno posledica konflikta na vratih 7654. Preverite dnevnike za potrditev.";
