    t[2954] = "Router info not available";
    t[2955] = "Informacije o usmerjevalniku niso na voljo";
    t[2956] = "The Java web applications listed below are started by the webConsole client and run in the same JVM as the router. They are usually web applications accessible through the router console. They may be complete applications (e.g. i2psnark), front-ends to another client or application which must be separately enabled (e.g. susidns, i2ptunnel), or have no web interface at all (e.g. addressbook).";
    t[2957] = "Spodaj navedene Java spletna aplikacije so za\u017eene s strani klienta webConsole in te\u010dejo v istem JVM kot usmerjevalnik. Obi\u010dajno so to spletna aplikacija dostopna prek konzole usmerjevalnika. Lahko so polne aplikacije (npr. i2psnark), frontalni deli za drugo klienta ali aplikacijo, ki mora biti lo\u010deno omogo\u010dena (npr. susidns, i2ptunnel), ali pa nimajo vsebinskega spletnega vmesnika (npr. addressbook).";
    t[2960] = "WARNING - Inbound 0-hop tunnels not recommended for hidden routers.";
    t[2961] = "OPOMBA - Vhodni 0-skokov tuneli niso priporo\u010deni za skrite usmerjevalnike.";
    t[2972] = "HTTP Proxy";
    t[2973] = "HTTP posredni\u0161ki stre\u017enik";
    t[2978] = "This is the total number of peers that are known by your router. They are listed on the <a href='/netdb'>Network Database page</a>. This may range from under 100 to 1000 or more. This number is not the total size of the network; it may vary widely depending on your total bandwidth, shared bandwidth, and locally-generated traffic. I2P does not require a router to know every other router in the network.";
    t[2979] = "To je skupno \u0161tevilo sosednjih stre\u017enikov, ki so znani va\u0161emu stre\u017eniku. So prikazani na <a href='/netdb'>strani za bazo podatkov omre\u017eja</a>. To lahko sega od pod 100 do 1000 ali ve\u010d. Ta \u0161tevilka ni skupna velikost omre\u017eja; lahko se zna\u010dajno razlikuje glede na va\u0161o skupno \u0161irino pasma, deljeno \u0161irino pasma, in lokalno ustvarjeno promet. I2P ne zahteva, da bi stre\u017enik znal vse druge stre\u017enike v omre\u017eju.";
