    t[3483] = "Ta nastavitev dolo\u010da, ali se statistike o na\u0161em usmerjevalniku nesistemati\u010dno objavljajo v NetDb. [Privzeto je false]";
    t[3486] = "This is the number of peers your router has available for building client tunnels. It is generally in the range 8-30. Your fast peers are shown on the <a href='/profiles'>Profiles page</a>. <a href='/configstats#router.fastPeers'>[Enable graphing]</a>";
    t[3487] = "To je \u0161tevilo sosednjih stre\u017enikov, ki jih ima va\u0161 stre\u017enik na voljo za izgradnjo tunelov klienta. Obi\u010dajno je v obsegu 8-30. Va\u0161i hitri sosednji stre\u017eniki so prikazani na <a href='/profiles'>strani za profila</a>. <a href='/configstats#router.fastPeers'>[Omogo\u010di grafe]</a>";
    t[3488] = "Click the <i>Reseed from File</i> button";
    t[3489] = "Kliknite gumb <i>Ponovno zalaganje iz datoteke</i>";
    t[3490] = "A variant of onion routing that encrypts multiple messages together to make it more difficult for attackers to perform traffic analysis and to increase the speed of data transfer. For more information, see the <a href=https://geti2p.net/en/docs/how/garlic-routing class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[3491] = "Razli\u010dica lukovnice usmerjanja, ki \u0161ifrirajo ve\u010d sporo\u010dil skupaj, da te\u017eko naredi za napadljike za analizo prometa in pove\u010danje hitrosti prenosa podatkov. Za ve\u010d informacij, glejte <a href=https://geti2p.net/en/docs/how/garlic-routing class='sitelink external' target=_blank rel=noreferrer>spletna dokumentacija</a>.";
    t[3494] = "How to Harden Your WordPress Site";
    t[3495] = "Kako izbolj\u0161ati varnost va\u0161ega WordPress mesta";
    t[3496] = "I2P Internals";
    t[3497] = "Notranji deli I2P";
    t[3500] = "By default, I2P is supplied with a webserver to host your own anonymized website (traditionally referred to as an <i>eepsite</i>). Both the site and the I2P Router Console are running on a streamlined version of <a href='https://en.wikipedia.org/wiki/Jetty_(web_server)' target=_blank rel=noreferrer class='sitelink external'>Jetty</a>, customized for I2P.";
    t[3501] = "Po privzemu je I2P opremljena s spletnim stre\u017enikom za gostovanje va\u0161e anonimizirane spletna stran (obi\u010dajno se nana\u0161a na <i>eepsite</i>). Oba mesta in konzola I2P stre\u017enik delata na preprostljivem razli\u010dici <a href='https://en.wikipedia.org/wiki/Jetty_(web_server)' target=_blank rel=noreferrer class='sitelink external'>Jetty</a>, prilagojene za I2P.";
    t[3504] = "This setting allows you to exclude older routers from your NetDb. Routers older than the default or the value you set will be deleted from the NetDb and banned for the duration of the router session. By default, routers older than 0.9.20 are excluded. Note: starting with I2P+ version 0.9.46+, only routers running very recent versions are used for building local tunnels. [Restart required]";
    t[3505] = "Ta nastavitev vam omogo\u010da izklju\u010diti starej\u0161e usmerjevalnike iz va\u0161e NetDb. Usmerjevalniki, starej\u0161i od privzetega ali vrednosti, ki jo nastavite, bodo izbrisani iz NetDb in prepovedani za trajanje sejansa usmerjevalnika. Privzeto so izklju\u010deni usmerjevalniki, star\u0161ki od 0.9.20. Opomba: za\u010dne z razli\u010dico I2P+ 0.9.46+, se uporabljajo le usmerjevalniki, ki delujejo zelo nedavne razli\u010dice, za izgradnjo lokalnih tuneljev. [Potreben je ponovni zagon]";
