    t[3624] = "This setting determines whether or not the router should use the provided <i>blocklist.txt</i> file and any user configured blocklists to enable banning of routers by hash or ip address. Ranges and net masks are supported for IPv4 but not IPv6. See the <i>blocklist.txt</i> in your I2P+ application directory for more info. [Enabled by default, restart required]";
    t[3625] = "Ta nastavitev dolo\u010da, ali naj usmerjevalnik uporablja podano datoteko <i>blocklist.txt</i> in kakr\u0161ne koli konfigurirane \u010drne listice uporabnika za omogo\u010danje prepovedi usmerjevalnikov po diju ali IP naslovu. Omre\u017eni razponi in maski so podprti za IPv4, vendar ne za IPv6. Za dodatne informacije glejte <i>blocklist.txt</i> v imeniku aplikacije I2P+. [Omogo\u010deno privzeto, potreben je ponovni zagon]";
