    t[3655] = "Uporabniki klientov, podobnih XChat, lahko ustvarijo novo omre\u017eje z stre\u017enikom <code>127.0.0.1/6668</code> (ne pozabite ozna\u010diti <i>Izstopajte posredni\u0161ki stre\u017enik</i>, \u010de imate nastavljen posredni\u0161ki stre\u017enik), ali pa se lahko pove\u017eete z ukazom <code>/server 127.0.0.1 6668</code>. Razli\u010dni IRC klienti lahko spreminjajo sintakso.";
