    t[3704] = "The router configuration options listed below are not available in the user interface, usually because they are rarely used or provide access to advanced settings that most users will not need. This is not a comprehensive list. Some settings will require a restart of the router to take effect. Note that all settings are case sensitive. You will need to edit your <code>router.config</code> file to add options, or, once you have added <code>routerconsole.advanced=true</code> to the router.config file, you may edit settings within the console on the <a href=/configadvanced>Advanced Configuration page</a>.";
    t[3705] = "Nastavitve konfiguracije usmerjevalnika, navedene spodaj, niso na voljo v uporabni\u0161kem vmesniku, obi\u010dajno zaradi manj\u0161ega uporabe ali ker omogo\u010dajo dostop do naprednih nastavitev, ki jih ve\u010dina uporabnikov ne potrebuje. To ni celovit seznam. Nekatere nastavitve zahtevajo ponovni zagon usmerjevalnika za u\u010dinkovanje. Opomba: vse nastavitve so osjetljive na velikost crk. Morate urediti svojo datoteko <code>router.config</code>, da dodate mo\u017enosti, ali pa, ko dodate <code>routerconsole.advanced=true</code> v datoteko router.config, lahko nastavite nastavitve v konzoli na strani <a href=/configadvanced>Napredna konfiguracija</a>.";
