    t[3961] = "Tako pred kratkim kon\u010dane posluge";
    t[3962] = "Some IRC clients are configured to disconnect from the server if there's been no communication with the server for a period of time, which can sometimes be problematic for I2P IRC if the <i>ping timeout</i> value is set too low. Setting the ping timeout value in your client to a high value (e.g. 320 seconds) will often result in a more robust connection to the network. In hexchat you can configure the value by typing <code>/set net_ping_timeout 320</code>. This will write the value to your <code>hexchat.conf</code> file.";
    t[3963] = "Nekateri IRC klienti so nastavljeni tako, da se razklopijo z stre\u017enikom, \u010de je nekaj \u010dasa ne obstaja komunikacija z stre\u017enikom, kar lahko v nekaterih primerih povzro\u010di te\u017eave za I2P IRC, \u010de je vrednost <i>\u010dasovnika ping</i> nastavljena prenizko. Nastavitev vrednosti \u010dasovnika ping v va\u0161em klientu na visoko vrednost (npr. 320 sekund) pogosto rezultira mo\u010dnej\u0161o povezavo z omre\u017ejem. V hexchat lahko vrednost nastavite tako, da tipkate <code>/set net_ping_timeout 320</code>. To bo vrednost zapise v va\u0161 <code>hexchat.conf</code> datoteko.";
    t[3964] = "Run at Startup?";
    t[3965] = "Za\u017eeni pri zagonu?";
    t[3972] = "Never";
    t[3973] = "Nikoli";
    t[3978] = "An <a href=/confignet#ipchange>optional configuration</a> that automatically changes your <a href=/netdb?r=.>router identity</a> and <a href=/confignet#udpconfig>external port</a> when the public ip address your system is on changes. This can prevent an adversary from correlating your router identity and ip address in scenarios where your ip address may change frequently, for example when you're running I2P on a laptop from multiple locations.";
    t[3979] = "Obvezna <a href=/confignet#ipchange>nastavitev</a>, ki samodejno spremeni svojo <a href=/netdb?r=.>identiteto stre\u017enika</a> in <a href=/confignet#udpconfig>zunanje vrata</a>, ko se javni ip naslov, na katerem je va\u0161 sistem, spremeni. To lahko prepre\u010di nasprotnika, da ujema va\u0161o identiteto stre\u017enika in ip naslov v scenarijih, kjer se va\u0161 ip naslov morda spreminja pogosto, na primer, ko pokre\u010dete I2P na prijenosnem ra\u010dunalniku iz ve\u010d mest.";
    t[3982] = "The router is not configured to publish its address, therefore it does not expect incoming connections.";
    t[3983] = "Stre\u017enik ni konfiguriran za objavo svojega naslova, zato ne pri\u010dakuje vhodnih povezav.";
    t[3998] = "A command-line application supplied with I2P+ (Linux/MacOS) that is used to perform a <code>head</code> request on a specified http resource on the network, returning various response headers from the remote server. By default, eephead uses the HTTP proxy on <code>127.0.0.1:4444</code>.";
    t[3999] = "Naredilna vrstica aplikacija, ki jo ponuja I2P+ (Linux/MacOS), ki se uporablja za izvedbo zahtevka <code>head</code> za dolo\u010deno http vire na omre\u017eju, vrnitev razli\u010dnih odgovorov glavice od oddaljenega stre\u017enika. Po privzemu, uporablja eephead HTTP posredni\u0161ki stre\u017enik na <code>127.0.0.1:4444</code>.";
    t[4010] = "NTCP [IPv6] &amp; SSU with Introducers";
