    t[4054] = "In order to access websites hosted on the I2P network, and optionally use the default outproxy to connect to websites on clearnet, you will need to configure your browser to use the I2P+ <b>HTTP</b> proxy, by default running on <code>127.0.0.1 port 4444</code>. For more help, see <a href=https://geti2p.net/htproxyports target=_blank rel=noreferrer>the configuration guide</a>, or <a href=/help/configuration#browserconfig>the mini-tutorial for Firefox</a>.";
    t[4055] = "Da bi dostopali do spletnih strani, gostiteljih na omre\u017eju I2P, in po \u017eelji uporabljali privzeti outproxy za povezavo z spletnimi stranmi na odkriti mre\u017ei, morate svoj brskalnik nastaviti na uporabo I2P+ <b>HTTP</b> posredni\u0161kega stre\u017enika, ki po privzemu deluje na <code>127.0.0.1 vrata 4444</code>. Za ve\u010d pomo\u010di, glejte <a href=https://geti2p.net/htproxyports target=_blank rel=noreferrer>vodilo za konfiguracijo</a>, ali <a href=/help/configuration#browserconfig>mini-tutorijal za Firefox</a>.";
