    t[4619] = "\u010ce je delena \u0161irina pasma vi\u0161ja, izbolj\u0161ate anonimnost in pomagate omre\u017eju.";
    t[4624] = "<b>Note:</b> On some Apache installations, the <a href=https://httpd.apache.org/docs/2.4/mod/mod_status.html target=_blank class='sitelink external'>mod_status</a> and <a href=https://httpd.apache.org/docs/2.4/mod/mod_info.html target=_blank class='sitelink external'>mod_info</a> modules are enabled by default. It is important to disable these, or otherwise protect access to the urls, to avoid compromising the anonymity and security of your server.";
    t[4625] = "<b>Opomba:</b> Na nekaterih namestitvah Apache, so moduli <a href=https://httpd.apache.org/docs/2.4/mod/mod_status.html target=_blank class='sitelink external'>mod_status</a> in <a href=https://httpd.apache.org/docs/2.4/mod/mod_info.html target=_blank class='sitelink external'>mod_info</a> omogo\u010deni privzeto. Je pomembno, da onemogo\u010dite te, ali pa druga\u010de za\u0161\u010ditite dostop do URL-jev, da prepre\u010dite kompromis anonimnosti in varnosti va\u0161ega stre\u017enika.";
