    t[5514] = "If after a few minutes of uptime your router is indicating 0 Active Peers and 0 Known Peers, with a notification in the sidebar that you need to check your network connection, verify that you can access the internet. If your internet connection is functional, you may need to unblock Java in your firewall. Otherwise, you may need to reseed your I2P router. Visit the <a href=/configreseed#reseedconfig>Reseed Configuration page</a> and click the <i>Save Changes and Reseed Now</i> button. For more information, see the <a href=#reseedhelp>Reseed help section</a> above.";
    t[5515] = "\u010ce po nekaj minutah \u010dasa delovanja va\u0161 usmerjevalnik pokazuje 0 Aktivnih partnerjev in 0 Znanih partnerjev, z obvestilom v stranici, da morate preveriti omre\u017eno povezavo, preverite, da lahko dostopate do interneta. \u010ce va\u0161a internetska povezava deluje, morda potrebujete razblokirati Java v firewallu. V nasprotnem primeru morda potrebujete ponovno semeniti svoj usmerjevalnik I2P. Obi\u0161\u010dite <a href=/configreseed#reseedconfig>Stran za konfiguracijo ponovnega semenjenja</a> in kliknite gumb <i>Shrani spremembe in ponovno semenjenje zdaj</i>. Za dodatne informacije glejte <a href=#reseedhelp>Seznam pomo\u010di za ponovno semenjenje</a> zgoraj.";
    t[5518] = "A higher level socket API for clients. Only opened when a SAM V3 client requests a UDP session. Can be enabled/disabled on the <a href=/configclients> Client Configuration page</a>. Can be changed in the <code>clients.config</code> file with the SAM command line option <code>sam.udp.port=nnnn</code>.";
    t[5519] = "Nadomestna raven vmesnika za vajalce. Odpre se le, ko vajaLEC SAM V3 zahteva UDP sejo. Omogo\u010dite/onemogo\u010dite na <a href=/configclients>Strani za konfiguracijo klienta</a>. Lahko spremenite v datoteki <code>clients.config</code> z ukazno vrsto SAM opcije <code>sam.udp.port=nnnn</code>.";
    t[5526] = "If you want your site to feel responsive, image compression is essential when hosting large images. Using a service like <a href=https://tinypng.com/ target=_blank class='sitelink external'>tinypng.com</a> to compress your png and jpeg images will often result in much smaller files with minimal loss of quality. In some situations the webp format can best jpegs, generating smaller files with approximately the same or better visual fidelity, and has wide browser support. Also consider using svgs instead of bitmaps for icons and illustrations - they're often smaller than the equivalent bitmap file (run them through a service like <a href=https://vecta.io/nano target=_blank class='sitelink external'>Nano SVG Optimizer</a> to remove unneeded cruft), scale without loss of quality, and can be gzipped by your webserver.";
    t[5527] = "\u010ce \u017eelite, da va\u0161a stran izgleda odzivna, je kompresija slik klju\u010dna pri gostovanju velikih slik. Uporaba storitve kot je <a href=https://tinypng.com/ target=_blank class='sitelink external'>tinypng.com</a> za kompresijo va\u0161ih slik png in jpeg obi\u010dajno rezultira z veliko manj\u0161imi datotekami z minimalno izgubo kakovosti. V nekaterih situacijah je format webp najbolj\u0161i jpegs, ustvarja manj\u0161e datoteke s pribli\u017eno isto ali bolj\u0161o vizualno zanesljivostjo, in ima \u0161iroko podporo brskalnikov. Tudi razmislite o uporabi svgs namesto bitmaps za ikone in ilustracije - so pogosto manj\u0161e od ekvivalentne datoteke bitmap (\u017eenite jih skozi storitev kot je <a href=https://vecta.io/nano target=_blank class='sitelink external'>Nano SVG Optimizer</a> za odstranitev nepotrebnega odpada), matri\u010dne bre izgube kakovosti, in jih lahko zgnati va\u0161 spletne stre\u017enik.";
    t[5528] = "UPnP disabled on the device";
