    t[5536] = "By default, most of your client services (mail, http proxy, IRC) will share the same set of tunnels (for performance reasons) and be listed as <i>Shared Clients</i> and <i>Shared Clients(DSA)</i> in the sidebar under Service Tunnels and on the <a href=/tunnels>Tunnels page</a>.";
    t[5537] = "Privzeto bo ve\u010dina va\u0161ih storitev klienta (po\u0161ta, http posredni\u0161ki stre\u017enik, IRC) delila isti nabor tuneljev (iz razlogov zmogljivosti) in je prikazana kot <i>Deleni klienti</i> in <i>Deleni klienti(DSA)</i> na stranici pod Service Tunnels in na strani <a href=/tunnels>Stran tuneljev</a>.";
