    t[5685] = "Preverite, ali uporablja drug program konfigurirana vrata. \u010ce je tako, ustavite ta program ali konfigurirajte I2P za uporabo drugega vrata.";
    t[5692] = "Manually edit peers and view banned peers and blocklist";
    t[5693] = "Ro\u010dno uredite sosednje stre\u017enike in ogled prepovedanih sosednjih stre\u017enikov in blokiranega seznama";
    t[5712] = "Firewalled with Inbound TCP Enabled";
    t[5713] = "Za\u0161\u010diten s firewallom z omogo\u010denim vhodnim TCP";
    t[5716] = "Open <a href=/confignet#udpconfig>I2P+'s port</a> on your modem, router and/or firewall(s) for better connectivity (ideally both UDP and TCP). More information on how to go about port forwarding can be found at <a href=http://portforward.com/ target=_blank rel=noreferrer class='sitelink external'>portforward.com</a>, in addition to our forums and IRC channels listed below. Note that I2P does not support connecting to the internet via an http or socks proxy [patches welcome!], though you can connect to proxies via I2P itself once connected to the network.";
    t[5717] = "Odpri <a href=/confignet#udpconfig>vrate I2P+</a> na va\u0161em modem, stre\u017eniku in/ali omejiteljih za bolj\u0161o povezanost (idealno oba UDP in TCP). Ve\u010d informacij o tem, kako usmeriti vrata, lahko najdete na <a href=http://portforward.com/ target=_blank rel=noreferrer class='sitelink external'>portforward.com</a>, poleg na\u0161ih forumov in IRC kanalov, navedenih spodaj. Opomba: I2P ne podpira povezovanja z interneto prek http ali socks posredni\u0161kega stre\u017enika [z veseljem sprejemamo popravke!], vendar lahko po povezavi z omre\u017ejem pove\u017eete na posredni\u0161ke stre\u017enike prek I2P samo.";
    t[5730] = "A tunnel filter can provide protection against denial of service attacks, without otherwise interrupting the service for genuine users, either in conjunction with the tunnel throttler or as an alternative strategy. It can also be used to log access to a hosted service to determine if the server is under attack, or simply to log all visitors by I2P destination. Additionally, a filter can function simultaneously as a whitelist and blacklist making it more flexible than the Tunnel Manager's access list controls. Note that multiple server tunnels can share a single filter file if you wish to implement a global filter.";
    t[5731] = "Filtr tunela lahko zagotovi za\u0161\u010dito proti napadi odklanjanja storitev, brez tega, da bi druga\u010de prekinil storitev za prave uporabnike, ali v sodelovanju z omejevalnikom tunela ali kot alternativna strategija. Lahko se tudi uporablja za dnevnik dostopa do gostiteljske storitve, da se dolo\u010di, ali je stre\u017enik pod napadom, ali pa preprosto dnevnik vseh obiskovalcev po destinaciji I2P. Poleg tega lahko filtr deluje hkrati kot bela in crna lista, kar ga naredi bolj prilagodljiv kot kontrole seznama dostopa Mened\u017eerja tunela. Opomba: Ve\u010d stre\u017enikov lahko deli eno filtrirno datoteko, \u010de \u017eelite implementirati globalni filtr.";
