    t[6026] = "This setting (in milliseconds) allows you to manually configure the delay between router refresh updates run by the Refresh Routers Job. By default the pause between refreshes is determined by the size of the NetDb, and introduces some randomness in the timing to mitigate traffic analysis. For values lower than 2000 milliseconds, increasing the value of <code>router.refreshTimeout</code> is recommended. Note that setting this value below 2000 milliseconds will increase your network traffic and may introduce job lag, and is not recommended for sustained use.";
    t[6027] = "Ta nastavitev (v milisekundah) vam omogo\u010da ro\u010dno konfiguriranje zamika med posve\u017eevanjem usmerjevalnika, izvedenim posluge osve\u017eevanja usmerjevalnika. Privzeto je pauza med osve\u017eevanjem dolo\u010dena glede na velikost NetDb, in v \u010dasovni razpored vstavlja nekaj naklju\u010dnosti, da olaj\u0161a analizo prometa. Za vrednosti manj\u0161e od 2000 milisekund, je priporo\u010dljivo pove\u010dati vrednost <code>router.refreshTimeout</code>. Opomba: nastavitev te vrednosti pod 2000 milisekund bo pove\u010dala va\u0161 omre\u017eni promet in lahko vnesla zamik posluge, in za stalno uporabo ni priporo\u010dljivo.";
    t[6030] = "Server tunnels, configurable in the <a href=/i2ptunnelmgr>Tunnel Manager</a>, provide a number of ways to limit access to the hosted service. Destination whitelisting, blacklisting, connection throttling, and tunnel filtering are methods provisioned to mitigate denial of service attacks, grant exclusive access to known I2P destinations, and manage traffic to the server.";
    t[6031] = "Stre\u017eni\u0161ki tuneli, nastavitljivi v <a href=/i2ptunnelmgr>Mened\u017eer tunela</a>, ponujajo ve\u010d na\u010dinov za omejitev dostopa do gostiteljske storitve. Bela lista destinacije, crna lista, omejitev povezav in filtriranje tunela so metode, ki so dolo\u010dene za zmanj\u0161anje napadov odklanjanja storitev, dajanje izklju\u010dnega dostopa do znanih destinacij I2P in upravljanje prometa do stre\u017enika.";
