    t[6382] = "Note: To enhance your security when browsing .i2p sites, you may wish to consider installing an addon to prevent Javascript from running in the browser such as <a href=https://addons.mozilla.org/en-US/firefox/addon/noscript/ target=_blank rel=noreferrer class='sitelink external'>NoScript</a>, though it's recommended to whitelist the address I2P+ is running on to enable various router console enhancements. In addition, an addon that prevents requests to offsite resources is also recommended, for example <a href=https://addons.mozilla.org/en-US/firefox/addon/umatrix/ target=_blank rel=noreferrer class='sitelink external'>uMatrix</a>.";
    t[6383] = "Opomba: Da bi izbolj\u0161ali va\u0161o varnost ob brskanju po .i2p straneh, morda \u017eelite razmisliti o namestitvi dodatka, da prepre\u010dite Javascript izvajanje v brskalniku, kot je <a href=https://addons.mozilla.org/en-US/firefox/addon/noscript/ target=_blank rel=noreferrer class='sitelink external'>NoScript</a>, \u010deprav je priporo\u010dljivo, da dodate naslov, na katerem te\u010de I2P+, v belo listo, da omogo\u010dite razli\u010dne izbolj\u0161ave konzole usmerjevalnika. Poleg tega je priporo\u010dljivo namestiti dodatek, ki prepre\u010di zahteve za viri izven spletne strani, npr. <a href=https://addons.mozilla.org/en-US/firefox/addon/umatrix/ target=_blank rel=noreferrer class='sitelink external'>uMatrix</a>.";
