    t[6762] = "I2P+ may be slow to integrate into network the first time you run it as it bootstraps into the network and learns of additional peers. The longer your I2P+ router is running, the better it will perform, so try and keep your router on as long as you can, 24/7 if possible! If, after 30 minutes, your <i>Active: [connected/recent]</i> count still has less than 10 peers, or your total number of <i>Integrated</i> peers is less than 5, there are several things you can do to check for problems:";
    t[6763] = "I2P+ se morda prvi\u010d, ko ga pokrenete, po\u010dasno integrira v omre\u017eje, saj se ujema v omre\u017eje in se u\u010di o dodatnih sosednjih stre\u017enikih. \u010ceprav va\u0161 stre\u017enik I2P+ deluje dalje, bo bolje deloval, zato poskusite dr\u017eati svoj stre\u017enik vklju\u010den kot najdalje, \u010de je mogo\u010de 24/7! \u010ce po 30 minutah \u0161e vedno ima va\u0161 <i>Aktiven: [povezan/recent]</i> \u0161tetje manj kot 10 sosednjih stre\u017enikov, ali pa je va\u0161e skupno \u0161tevilo <i>integriranih</i> sosednjih stre\u017enikov manj kot 5, obstaja ve\u010d stvari, ki jih lahko storite, da preverite te\u017eave:";
