    t[7158] = "I2P does not work well behind this type of firewall. You will probably not be able to accept inbound connections, which will limit your participation in the network.";
    t[7159] = "I2P ne deluje dobro iza tega vrsta omejevalca. Verjetno ne boste mogli sprejemati vhodnih povezav, kar bo omejilo va\u0161e sodelovanje v omre\u017eju.";
    t[7166] = "The I2P Client Protocol (I2CP) enables external applications (clients) to communicate with I2P over single TCP socket, by default using port 7654. For more information, see the <a href=https://geti2p.net/en/docs/protocol/i2cp class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7167] = "Protokol I2P Klienta (I2CP) omogo\u010da komunikacijo zunanjih aplikacij (klientov) z I2P preko enega TCP vrat, po privzemu uporablja vrata 7654. Za ve\u010d informacij, glejte <a href=https://geti2p.net/en/docs/protocol/i2cp class='sitelink external' target=_blank rel=noreferrer>spletna dokumentacija</a>.";
    t[7168] = "Queue Totals";
    t[7169] = "Skupaj vrste";
    t[7170] = "This setting determines which transport takes priority when communicating with peers. By default, NTCP is favored over UDP (SSU). By setting the value to true, UDP will be favored unless a pre-existing NTCP connection exists; when set to always, UDP will always be used regardless of any pre-existing NTCP connection. [Default is false]";
    t[7171] = "Ta nastavitev dolo\u010da, kateri prenos ima prednost pri komunikaciji z sosednjimi stre\u017eniki. Po privzemu je NTCP izbran pred UDP (SSU). \u010ce nastavite vrednost na true, bo UDP izbran, razen \u010de obstaja predhodno vzpostavljena povezava NTCP; ko je nastavljeno na vedno, bo UDP vedno uporabljen, ne glede na katero koli predhodno vzpostavljeno povezavo NTCP. [Privzeto je false]";
