    t[7284] = "The data gathered is quantized over a 1 minute period, so should just be used as an estimate.";
    t[7285] = "Zbrana podatka je kvantizirana v 1-minutnem obdobju, zato bi jo moral uporabiti samo kot oceno.";
    t[7292] = "When set to true, I2P runs without network connectivity, which is helpful if you are constantly restarting the router to test code updates as this prevents network disruption.";
    t[7293] = "Ko je nastavljeno na true, deluje I2P brez omre\u017ene povezanosti, kar je uporabno, \u010de neprestano ponovno zagnate usmerjevalnik za preizpito posodobitve kode, saj to prepre\u010di prekinitev omre\u017eja.";
    t[7302] = "Updating IP address";
    t[7303] = "Posodabljanje IP naslova";
    t[7308] = "SSU [IPv6 Only] with Introducers";
    t[7309] = "IPv6 le SSU, predstavljeni";
    t[7312] = "SSU (Secure Semi-reliable UDP) is an I2P network transport providing encrypted, connection-oriented, point-to-point connections, in addition to IP address detection and NAT traversal services. For more information, see the <a href=https://geti2p.net/en/docs/transport/ssu class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7313] = "SSU (UDP, ki je varno polzanesljivo) je prenos I2P omre\u017eja, ki pru\u017ea \u0161ifrirane, usmerjene po povezavi, to\u010dka do to\u010dke povezave, poleg zaznavanja IP naslova in storitev za prehod NAT. Za ve\u010d informacij, glejte <a href=https://geti2p.net/en/docs/transport/ssu class='sitelink external' target=_blank rel=noreferrer>spletna dokumentacija</a>.";
    t[7314] = "Congestion window";
    t[7315] = "Okno zastoja";
    t[7326] = "Use Proxy to Reseed";
    t[7327] = "Uporabi posredni\u0161ki stre\u017enik za ponovno semenjenje";
    t[7328] = "Until the advent of I2P integration in <a href=http://www.vuze.com/ target=_blank rel=noreferrer class='sitelink external'>Vuze</a>, it wasn't possible to download torrents that weren't hosted on the I2P network. However, now that Vuze (and latterly <a href=https://www.biglybt.com/ target=_blank rel=noreferrer class='sitelink external'>Bigly</a>) allow users to share non-I2P torrents on I2P, non-I2P torrents can be downloaded over I2P if Vuze/Bigly users have chosen to make content available to the I2P network. Popular torrents with a large number of peers are more likely to be accessible via I2P; to determine if the content is available, add the torrent link, magnet or infohash to your I2P-enabled BitTorrent client.";
    t[7329] = "Razen \u010de je nastala integracija I2P v <a href=http://www.vuze.com/ target=_blank rel=noreferrer class='sitelink external'>Vuze</a>, ni bilo mogo\u010de prenesti torrentov, ki niso gostiljstvo na omre\u017eju I2P. Vendar, zdaj ko Vuze (in kasneje <a href=https://www.biglybt.com/ target=_blank rel=noreferrer class='sitelink external'>Bigly</a>) omogo\u010da uporabnikom, da delijo ne-I2P torrente na I2P, se ne-I2P torrenti lahko preneseta preko I2P, \u010de so uporabniki Vuze/Bigly izbrali, da vsebino ponujajo omre\u017eju I2P. Priljubljene torrente z veliko \u0161tevilo partnerjev so bolj verjetno dostopni prek I2P; za dolo\u010danje, ali je vsebina na voljo, dodajte povezavo torrenta, magnet ali infohash v va\u0161 BitTorrent klient, omogo\u010den za I2P.";
