    t[7443] = "Pomo\u010d usmerjevalnika in \u010cPP";
    t[7444] = "If a <i>Registration Authentication</i> string is requested, you can find it on the <a href='http://127.0.0.1:7657/i2ptunnel/register?tunnel=3'>Registration Authentication page</a> linked from the <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>. Registration authentication ensures only the owner is able to register or otherwise manage the hostname, and is required on stats.i2p and reg.i2p.";
    t[7445] = "\u010ce je zahtevana niz <i>Registracijska overitev</i>, ga lahko najdete na strani <a href='http://127.0.0.1:7657/i2ptunnel/register?tunnel=3'>Registracijska overitev</a>, povezan z <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Nastavitve mened\u017eera tunela</a>. Registracijska overitev zagotavlja, da lahko registrira ali druga\u010de upravlja s imenom gostitelja le lastnik, in je potrebna na stats.i2p in reg.i2p.";
    t[7448] = "News &amp; Updates";
    t[7449] = "Novice &amp; posodobitve";
    t[7452] = "[Linux/Unix/Solaris] If you can't start the router with <code>i2p/i2prouter start</code> try the <code>runplain.sh</code> script in the same directory. Root privileges are never required to run I2P+. If you need to compile the <a href=http://i2p-projekt.i2p/jbigi.html target=_blank rel=noreferrer>jBigi library</a> (which is necessary in rare cases), consult the documentation, visit the forums, or visit <a href=irc://127.0.0.1:6668/saltR class=chatlink>the I2P+ channel</a> or <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>IRC developer channel</a>.";
    t[7453] = "[Linux/Unix/Solaris] \u010ce ne morete zagnati stre\u017enika z <code>i2p/i2prouter start</code>, poskusite z <code>runplain.sh</code> skripto v isti mapi. Root privilegije nikoli niso potrebne za delovanje I2P+. \u010ce morate kompilirati <a href=http://i2p-projekt.i2p/jbigi.html target=_blank rel=noreferrer>knji\u017enico jBigi</a> (kar je potrebno v rijetkih primerih), posvetujte dokumentacijo, obi\u0161\u010dite fora, ali obi\u0161\u010dite <a href=irc://127.0.0.1:6668/saltR class=chatlink>kanal I2P+</a> ali <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>IRC kanal za razvijalce</a>.";
