    t[7690] = "A distributed database containing router contact information (RouterInfos) and destination contact information (LeaseSets). A single router maintains its own (partial) database for communicating with other routers on the network; no single router will maintain a list of all routers. The RouterInfos are stored on disk and read into memory when the router starts, or when new RouterInfos are acquired. Also referred to as the <i>NetDb</i>. For more information, see the <a href=https://geti2p.net/en/docs/how/network-database class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7691] = "Raz\u0161irjena baza podatkov, ki vsebuje informacije o kontaktu usmerjevalnika (RouterInfos) in informacije o kontaktu namenskega (LeaseSets). En samostojen usmerjevalnik vzdr\u017euje svojo (delno) bazo podatkov za komunikacijo z drugimi usmerjevalniki na omre\u017eju; noben samostojen usmerjevalnik ne bo vzdr\u017eeval seznama vseh usmerjevalnikov. RouterInfos so shranjeni na disk in prebrani v pomnilnik, ko se usmerjevalnik zagni, ali ko so pridobljeni novi RouterInfos. Tudi se omenja kot <i>NetDb</i>. Za ve\u010d informacij, glejte <a href=https://geti2p.net/en/docs/how/network-database class='sitelink external' target=_blank rel=noreferrer>spletna dokumentacija</a>.";
    t[7692] = "Address";
    t[7693] = "Naslov";
    t[7694] = "A threshold is defined by the number of connection attempts a remote destination is permitted to perform over a specified number of seconds before a \"breach\" occurs.";
    t[7695] = "Prag je dolo\u010den z \u0161tevilom poskusov povezave, ki jih je daljanska destinacija dovoljena izvede v dolo\u010denem \u0161tevilu sekund preden se zgodi \"kr\u0161itev\".";
    t[7704] = "Clearnet normally refers to the publicly accessible internet, the opposite of the darknet that typically describes the encrypted, anonymous services built on I2P, Tor etc. For more information, see the <a href=https://en.wikipedia.org/wiki/Clearnet_(networking) class='sitelink external' target=_blank rel=noreferrer>Wikipedia article</a>.";
    t[7705] = "Jasno omre\u017eje obi\u010dajno se nana\u0161a na javno dostopno internet, nasprotno s tem je darknet, ki tipi\u010dno opisuje \u0161ifrirane, anonimne storitve, izgrajene na I2P, Tor itd. Za ve\u010d informacij, glejte <a href=https://en.wikipedia.org/wiki/Clearnet_(networking) class='sitelink external' target=_blank rel=noreferrer>\u010dlanek Wikipedia</a>.";
