    t[7991] = "Usmerjevalnik na omre\u017eju, ki je nalogovana z zagotavljanjem in prejemanjem informacij o drugih usmerjevalnikeh in storitvah na omre\u017eju. Sedajnja minimalna dodeljena \u0161irina pasma za usmerjevalnik, da se obravnava kot sposoben opravljanja nalog floodfill, je 128 KBytes / sec, vendar je mogo\u010de prenesti to zahtevo in prisiliti usmerjevalnik, da je floodfill na <a href=/configadvanced>Strani za napredno konfiguracijo</a>. Za ve\u010d informacij, glejte <a href=https://geti2p.net/en/docs/how/network-database#floodfill class='sitelink external' target=_blank rel=noreferrer>spletna dokumentacija</a>.";
