    t[8208] = "Wherever possible, assets that are used repeatedly on your site should be loaded from an external file and not inlined. If you're using the same CSS on several pages, create a separate css file and load that in the <code>&lt;head&gt;</code> section of your pages. This will make styling updates to your site easier to manage, and will also allow the file to be cached in the visitor's browser, resulting in less bandwidth demands on your webserver and faster page loads for your visitors.";
    t[8209] = "Kjer je mogo\u010de, sredstva, ki se na va\u0161i strani uporabljajo ponovno, bi morala biti nalo\u017eena iz zunanje datoteke in ne vgrajena. \u010ce na ve\u010d strani uporabljate enako CSS, ustvarite lo\u010deno css datoteko in nalo\u017eite to v <code>&lt;head&gt;</code> sekciji va\u0161ih strani. To bo izbolj\u0161alo nadzor nad posodobitvami stilizacije va\u0161e strani, in bo tudi omogo\u010dil datoteko, da se shrani v predpomnilnik brskalnika obiskovalca, kar rezultira z manj\u0161imi zahtevami za \u0161irino pasma va\u0161ega spletne stre\u017enika in hitrej\u0161imi nalo\u017eitvami strani za va\u0161e obiskovalce.";
