    t[8310] = "When you start I2P, it may take a few minutes to bootstrap (integrate) your router into the network and find additional peers, so please be patient.";
    t[8311] = "Ko zagnate I2P, lahko potrebuje nekaj minut za ujemanje (integracija) va\u0161ega stre\u017enika v omre\u017eje in iskanje dodatnih sosednjih stre\u017enikov, zato prosim, da budete strpelni.";
