    t[8335] = "Funkcija";
    t[8336] = "On the I2P network, remotely hosted services can be accessed using a <a href=https://en.wikipedia.org/wiki/Base32 target=_blank rel=noreferrer class='sitelink external'>Base32</a> address ending in \".b32.i2p\", a <i>destination</i> represented as a long <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external'>Base64</a> string, or more usually by using an .i2p domain. A destination is I2P's equivalent to an IP address, and is shown on the <a href='/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>. You can share your b32.i2p address to allow others to access to your website until you've registered your own .i2p domain.";
    t[8337] = "Na omre\u017eju I2P, storitve oddaljeno gostiljeni se lahko dostopi z uporabo <a href=https://en.wikipedia.org/wiki/Base32 target=_blank rel=noreferrer class='sitelink external'>Base32</a> naslova, kon\u010dajo\u010dega z \".b32.i2p\", <i>namen</i>, predstavljen kot dolg <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external'>Base64</a> niz, ali pogosteje z uporabo domene .i2p. Namen je ekvivalent I2P do IP naslova, in je prikazan na <a href='/i2ptunnel/edit?tunnel=3'>strani za konfiguracijo mened\u017eerja tunela</a>. Lahko delite svoj naslov b32.i2p, da drugim omogo\u010dite dostop do va\u0161e spletne strani, dokler ne registrirate svoje domene .i2p.";
