    t[8554] = "If you're not using IE, it's likely that your browser is pretending to be IE; please configure your browser (or proxy) to use a different User Agent string if you'd like to access the console themes.";
    t[8555] = "\u010ce ne uporabljate IE, je verjetno, da se va\u0161 brskalnik pretvarja, da je IE; prosim, konfigurirajte va\u0161 brskalnik (ali posredni\u0161ki stre\u017enik), da uporabi druga\u010dno niz Uporabnikov agent, \u010de \u017eelite dostop do tem konzole.";
    t[8564] = "Privacy-focused Clearnet Search Engine";
    t[8565] = "Iskalnik Clearnet usmerjen na zasebnost";
    t[8572] = "<a href=/logs>Logs</a> may help resolve a problem. You may wish to paste excerpts in a <a href=http://i2pforum.i2p/ target=_blank rel=noreferrer>forum</a> for help, or perhaps <a href=http://cake.i2p/pastebin/ target=_blank rel=noreferrer class='sitelink external'>paste</a> it instead and reference the link on IRC for help.";
    t[8573] = "<a href=/logs>Dnevniki</a> lahko pomagajo re\u0161iti problem. Mogo\u010de \u017eelite vlo\u017eiti izvle\u010dke v <a href=http://i2pforum.i2p/ target=_blank rel=noreferrer>forum</a> za pomo\u010d, ali pa morda <a href=http://cake.i2p/pastebin/ target=_blank rel=noreferrer class='sitelink external'>vlo\u017eite</a> to namesto tega in se posvetujte z povezavo na IRC za pomo\u010d.";
    t[8574] = "Plugins signed with the cryptographic key of the developer are the recommended format, but if you wish to install unsigned plugins (.zip) you can set this to true. Note that you may still encounter issues attempting to install an unsigned plugin if the developer has included additional checks in the plugin build process.";
    t[8575] = "Vstavki, podpisani z kriptografskim klju\u010dem razvijalca, so priporo\u010deni format, vendar \u010de \u017eelite namestiti nepodpisane vstavke (.zip), lahko to nastavite na true. Opomba: morda se naletite na te\u017eave pri poskusu namestitve nepodpisane vstavke, \u010de je razvijalec vklju\u010dil dodatne preglede v postopek izdelave vstavke.";
    t[8578] = "If you are running a standalone Tor instance locally, you may use it by configuring I2P to use: <i>Proxy type:</i> <code>SOCKS 5</code> <i>Host:</i> <code>127.0.0.1</code> <i>Port:</i> <code>9050</code>.";
    t[8579] = "\u010ce lokalno pokrenete samostojno instanco Tor, jo lahko uporabite tako, da nastavite I2P za uporabo: <i>Vrsta posredni\u0161kega stre\u017enika:</i> <code>SOCKS 5</code> <i>Gostitelj:</i> <code>127.0.0.1</code> <i>Vrata:</i> <code>9050</code>.";
    t[8584] = "Select the language to be used for the router console and web applications (<a href=/webmail target=_blank rel=noreferrer>webmail</a>, <a href=/torrents target=_blank rel=noreferrer>torrents</a>, <a href=/i2ptunnelmgr target=_blank rel=noreferrer>tunnel manager</a> etc). If you wish to change the language in future, change the router console theme, or configure a password to access the console, you may do so on the <a href=/configui target=_blank rel=noreferrer>User Interface configuration page</a>.";
    t[8585] = "Izberite jezik, ki ga \u017eelite uporabiti za konzolo stre\u017enika in spletna aplikacija (<a href=/webmail target=_blank rel=noreferrer>webmail</a>, <a href=/torrents target=_blank rel=noreferrer>torrenti</a>, <a href=/i2ptunnelmgr target=_blank rel=noreferrer>menad\u017eer tunela</a> itd.). \u010ce \u017eelite v prihodnosti spremeniti jezik, spremeniti temo konzole stre\u017enika, ali konfigurirati geslo za dostop do konzole, lahko to storite na <a href=/configui target=_blank rel=noreferrer>strani za konfiguracijo uporabni\u0161kega vmesnika</a>.";
