    t[9052] = "Ready";
    t[9053] = "Pripravljen";
    t[9056] = "These are the local services provided by your router. They may be clients started through the <a href='/i2ptunnelmgr'>Tunnel Manager</a> or external programs connecting through SAM, BOB, or directly to I2CP. By default, most of your client services (mail, http proxy, IRC) will share the same set of tunnels and be listed as <i>Shared Clients</i> and <i>Shared Clients(DSA)</i>, which enhances anonymity by blending the traffic from all shared services, and reduces the overhead required to build and maintain tunnels. However, if you experience a tunnel failure, all your services will go offline at the same time, so in some scenarios you may wish to configure client services to use their own set of tunnels. This can be done by unchecking the <i>Share tunnels with other clients&hellip;</i> option listed under <i>Shared Clients</i> on the configuration page of the relevant client service in the Tunnel Manager, after which you will need to restart the client service from the <a href='/i2ptunnelmgr'>main Tunnel Manager page</a>.";
    t[9057] = "To so lokalne storitve, pru\u017eene od va\u0161ega stre\u017enika. Lahko so klienti, za\u010deti preko <a href='/i2ptunnelmgr'>Mened\u017eer tunela</a> ali zunanjih programov, povezanih prek SAM, BOB, ali neposredno do I2CP. Po privzemu, ve\u010dina va\u0161ih storitev klienta (po\u0161ta, http posredni\u0161ki stre\u017enik, IRC) bodo delili enak nabor tunelov in bodo navedeni kot <i>Deljeni klienti</i> in <i>Deljeni klienti(DSA)</i>, kar izbolj\u0161a anonimnost z me\u0161anjem prometa iz vseh deljenih storitev, in zmanj\u0161a nadomestne stro\u0161ke za izgradnjo in vzdr\u017eevanje tunelov. Vendar, \u010de do\u017eivite neuspeh tunela, vse va\u0161e storitve se bodo isto\u010dasno odstranile iz spletne strani, tako da v nekaterih scenarijih morda \u017eelite nastaviti storitve klienta, da uporabljajo svoj nabor tunelov. To lahko storite tako, da prekli\u010dete mo\u017enost <i>Deljeni tuneli z drugimi klienti&hellip;</i>, navedeno pod <i>Deljeni klienti</i> na strani za konfiguracijo ustrezne storitve klienta v Mened\u017eer tunela, po \u010demer boste morali ponovno zagnati storitev klienta s <a href='/i2ptunnelmgr'>glavne strani mened\u017eerja tunela</a>.";
