    t[9354] = "Reseeding is the bootstrapping process used to find other routers when you first install I2P, or when your router has too few router references remaining. The default settings will work for most people. Change these only if HTTPS is blocked by a restrictive firewall and reseed has failed.";
    t[9355] = "Ponovno zalaganje je postopek ujemanja, ki se uporablja za iskanje drugih stre\u017enikov, ko prvi\u010d namestite I2P, ali ko va\u0161 stre\u017enik ima premalo referenc na stre\u017enike. Privzete nastavitve bodo delovali za ve\u010dino ljudi. Te nastavitve spremenite le, \u010de je HTTPS blokiran omejivcem firewall in ponovno zalaganje ni uspelo.";
    t[9362] = "This setting, when enabled, modifies the maximum additional random pong delay introduced for ping-enabled servers, if <code>i2p.streaming.enablePongDelay</code> is also enabled. Unless explicitly set, the default value of 50ms will be used.";
    t[9363] = "Ta nastavitev, ko je omogo\u010dena, spremeni maksimalno naklju\u010dno zamudo pong odgovora za stre\u017enike, ki podpirajo ping, \u010de je tudi omogo\u010dena i2p.streaming.enablePongDelay. \u010ce ni jasno dolo\u010deno, se uporabi privzeto vrednost 50 ms.";
