    t[9474] = "Your I2P+ router by default contributes to the network by routing internal, end-to-end encrypted traffic for other routers, known as <i>participation</i>. Bandwidth participation improves the anonymity level of all users on the network and maximizes your download speed.";
    t[9475] = "Va\u0161 stre\u017enik I2P+ privzeto prispeva k omre\u017eju tako, da usmerja notranji, \u0161ifrirani promet od konca do konca za druge stre\u017enike, znane kot <i>sodelovanje</i>. Sodelovanje v \u0161irini pasma izbolj\u0161a ravni anonimnosti vseh uporabnikov v omre\u017eju in dose\u017ee maksimalno hitrost prenosov.";
    t[9476] = "This setting permits the configuration of alternative NTP servers required to ensure that your router maintains accurate clock time. [Default is 0.pool.ntp.org,1.pool.ntp.org,2.pool.ntp.org]";
    t[9477] = "Ta nastavitev dovoli konfiguracijo alternativnih stre\u017enikov NTP, potrebnih za zagotavljanje, da va\u0161 usmerjevalnik vzdr\u017euje to\u010den \u010das na uro. [Privzeto je 0.pool.ntp.org,1.pool.ntp.org,2.pool.ntp.org]";
    t[9484] = "Optimize your images";
    t[9485] = "Optimizirajte svoje slike";
    t[9488] = "Note that the profiler relies on sustained client tunnel usage to accurately profile peers.";
    t[9489] = "Opomba: Profiler se zana\u0161a na trajno uporabo klientovih tuneljev za precizno profiliranje partnerjev.";
    t[9492] = "If you are in a hurry and can't wait a few hours, you can tell people to use a \"jump\" address helper redirection service. This will usually work within a few minutes of your registering your hostname on the same site. Test it yourself first by entering <code>http://stats.i2p/cgi-bin/jump.cgi?a=<i>yourchosenhostname.i2p</i></code> into your browser. Once it is working, you can tell others to use it.";
    t[9493] = "\u010ce ste v teku in ne morete po\u010dakati nekaj ur, ljudem lahko sporo\u010dite, da uporabljajo storitev usmerjanja pomo\u010dnika naslova \"skok\". To obi\u010dajno deluje znotraj nekaj minut po registraciji va\u0161ega imena gostitelja na istem mestu. Najprej se sami preizkusite, vnesite <code>http://stats.i2p/cgi-bin/jump.cgi?a=<i>izbranoimegostitelja.i2p</i></code> v brskalnik. Ko to deluje, lahko drugim sporo\u010dite, da to uporabljajo.";
