    t[9580] = "Note that the full path to the output files must be accessible before deploying the filter. If the target directory does not exist, the destinations will not be recorded and an error will appear in the router logs. The files will be created as required. The examples provided above are not recommendations; your configuration should be tuned according to the amount of content (number and size of files) your site is serving, the speed of the server, and the frequency with which the site is updated. Configuring recorders and monitoring the resulting files will help you fine tune the settings.";
    t[9581] = "Opomba: Celoten pot do izhodnih datotek mora biti dostopen pred zaposlitev filtra. \u010ce ciljna mapa ne obstaja, destinacije ne bodo zapise in napaka bo prikazana v dnevnikih stre\u017enika. Datoteke bodo ustvarjene po potrebi. Zgornji primeri niso priporo\u010dila; va\u0161a konfiguracija bi morala biti prilagodljiva glede na koli\u010dino vsebine (\u0161tevilo in velikost datotek), ki jo slu\u017ei va\u0161a spletna stran, hitrost stre\u017enika, in frekvenco, s katero je spletna stran posodobljena. Nastavitev zapisovalcev in nadzor rezultirajo\u010dih datotek vam bo pomagal precizno prilagoditi nastavitve.";
