    t[9630] = "Tunnels built by other routers through your router. This may vary widely depending on network demand, your shared bandwidth, and amount of locally-generated traffic. The recommended method for limiting participating tunnels is to change your share percentage on the <a  href='/config'>Bandwidth Configuration page</a>. You may also limit the total number by setting <code>router.maxParticipatingTunnels=nnn</code> on the <a href='/configadvanced'>Advanced configuration page</a>. <a href='/configstats#tunnel.participatingTunnels'>[Enable graphing]</a>.";
    t[9631] = "Tuneli izgradnjeni od drugih stre\u017enikov skozi va\u0161 stre\u017enik. To lahko veliko razlikuje glede na zahteve omre\u017eja, va\u0161o deljeno \u0161irino pasma, in koli\u010dino lokalno ustvarjenega prometa. Priporo\u010den metod za omejitev sodelujocih tunelov je sprememba va\u0161ega dele\u017ea na <a  href='/config'>strani za konfiguracijo \u0161irine pasma</a>. Lahko tudi omejite skupno \u0161tevilo tako, da nastavite <code>router.maxParticipatingTunnels=nnn</code> na <a href='/configadvanced'>strani za napredno konfiguracijo</a>. <a href='/configstats#tunnel.participatingTunnels'>[Omogo\u010di grafe]</a>.";
