    t[10038] = "To configure an alternative webserver for use on I2P, you can either use the existing webserver tunnel and <a href=/configclients>disable the default webserver</a> from running, or create a new HTTP Server tunnel in the <a href=/i2ptunnelmgr>Tunnel Manager</a>. Ensure that the webserver's <i>listening port</i> is also configured in the Tunnel Manager settings. For example, if your webserver is listening by default on address 127.0.0.1 port 80, you'd also need to ensure that the <i>Target port</i> in the Tunnel Manager settings page for the service is also configured to port 80.";
    t[10039] = "Da konfigurirate alternativni spletne stre\u017enik za uporabo na I2P, lahko uporabite obstoje\u010di tunel spletne stre\u017enika in <a href=/configclients>onemogo\u010dite privzeti spletne stre\u017enik</a> za pokretanje, ali ustvarite nov HTTP Server tunel v <a href=/i2ptunnelmgr>Mened\u017eer tunela</a>. Poskrbite, da je vrata spletne stre\u017enika, ki <i>posluha</i>, tudi konfigurirano v nastavitvah mened\u017eerja tunela. Na primer, \u010de va\u0161 spletne stre\u017enik posluha privzeto na naslovu 127.0.0.1 vrata 80, bi morali tudi zagotoviti, da je <i>vrata cilja</i> na strani nastavitev mened\u017eerja tunela za storitev tudi konfigurirano na vrata 80.";
