    t[10046] = "An I2P router usually only needs to be seeded once, to join the network for the first time. However, if the router is running for an extended period without network connectivity it may also need to be reseeded. Reseeding involves fetching multiple \"RouterInfo\" files (bundled into a signed zip-file) from at least two predefined server URLs picked from a volunteer-run group of clearnet HTTPS servers.";
    t[10047] = "Stre\u017enik I2P obi\u010dajno potrebuje samo enkratno zalaganje, da se prvi\u010d pridru\u017ei omre\u017eju. Vendar, \u010de stre\u017enik dolgo \u010dasa deluje brez omre\u017ene povezave, ga lahko tudi ponovno zalaga. Ponovno zalaganje vklju\u010duje prenos ve\u010d \"RouterInfo\" datotek (obvezno v podpisani zip-datoteki) iz vsaj dveh preddefiniranih URL stre\u017enikov, izbranih iz skupine dobrodelno skrbilcev, ki vodi skupino HTTPS stre\u017enikov na odkriti mre\u017ei.";
    t[10050] = "Are you sure you want to delete {0}?";
