    t[10318] = "Where possible, please ensure I2P+/Java is allowed bi-directional port access from the internet by configuring your modem/router/pc firewall accordingly. If you're behind a prohibitive firewall but have unrestricted outbound access, I2P+ can still function; you can turn off inbound access and rely on <a href=http://i2p-projekt.i2p/udp.html target=_blank rel=noreferrer class=sitelink>SSU IP Address Detection</a> (<a href=https://wikipedia.org/wiki/Hole_punching target=_blank rel=noreferrer class='sitelink external'>firewall hole punching</a>) to connect you to the network, and your network status in the side panel will indicate \"Status: Firewalled\". For optimal performance, please ensure I2P's <a href=/confignet#udpconfig>external port</a> is visible from the internet (see below for more information).";
    t[10319] = "Kjer je mogo\u010de, se prosimo, da zagotovite, da je I2P+/Java dovoljena dvosmerna dostop do vrata iz interneta, tako da ustrezno nastavite svoj modem/router/oomejitelj PC. \u010ce ste za omejitev omejitelja, vendar imate neomejen izhodni dostop, lahko I2P+ \u0161e vedno deluje; lahko izklju\u010dite vhodni dostop in se osredoto\u010dite na <a href=http://i2p-projekt.i2p/udp.html target=_blank rel=noreferrer class=sitelink>SSU Odkrivanje IP naslova</a> (<a href=https://wikipedia.org/wiki/Hole_punching target=_blank rel=noreferrer class='sitelink external'>omejitelj odkrivanje lu\u010dke</a>) za povezavo z omre\u017ejem, in va\u0161e stanje omre\u017eja na strani vrstnice bo prikazalo \"Stanje: Omejitev\". Za optimalno delovanje se prosimo, da zagotovite, da je I2P's <a href=/confignet#udpconfig>zunanje vrat</a> vidno iz interneta (glejte spodaj za ve\u010d informacij).";
