    t[10711] = "Postopek pridobivanja identitet usmerjevalnika, obi\u010dajno prek stre\u017enikov <i>jasnega omre\u017eja</i>, da se zagotovi, da lahko va\u0161 usmerjevalnik komunicira in izgradi tunele z drugimi usmerjevalniki na omre\u017eju. Ko usmerjevalnik nimajo identitet usmerjevalnika za druge sosednje stre\u017enike (obi\u010dajno takoj po namestitvi), je postopek ponovnega zalaganja tudi poimenovana kot <i>ujemanje</i>.";
