    t[10746] = "A tunnel used by the router for communicating with other routers to perform various \"housekeeping\" functions such as learning and publishing <i>leasesets</i>, testing client tunnels, and learning about and validating other routers in the network. These tunnels are normally low-bandwidth.";
    t[10747] = "Tunel, ki ga uporablja usmerjevalnik za komunikacijo z drugimi usmerjevalniki za izvedbo razli\u010dnih \"\u010di\u0161\u010denjskih\" funkcij, kot so u\u010denje in objavljivanje <i>leaseset-ov</i>, testiranje klientnih tunelov, in u\u010denje o in preverjanje drugih usmerjevalnikov v omre\u017eju. Ti tuneli so obi\u010dajno z majhno \u0161irino pasma.";
    t[10752] = "Debug";
