    t[10760] = "Reseeding is the bootstrapping process used to find other routers when you first install I2P, or when your router has too few router references remaining.";
    t[10761] = "Ponovno semenjenje je postopek za\u017eenitve, ki se uporablja za iskanje drugih usmerjevalnikov, ko prvi\u010d namestite I2P, ali ko va\u0161 usmerjevalnik ima pre malo ostalih referenc usmerjevalnikov.";
    t[10766] = "An alternative implementation of an I2P router coded in C++. For more information, see <a href=https://i2pd.website/ class='sitelink external' target=_blank rel=noreferrer>https://i2pd.website/</a> Source code is available on <a href=https://github.com/PurpleI2P/i2pd class='sitelink external' target=_blank rel=noreferrer>github</a>.";
