    t[11021] = "Vstavek ne more biti kopiran v imenik {0}";
    t[11024] = "By default, I2P will use the system configured default browser to launch at startup. If you wish to nominate an alternative browser, you will need to edit your router.config file (or the <a href=/configadvanced>Advanced Configuration page</a> if you have enabled advanced console mode) and add a new configuration line <code>routerconsole.browser=/path/to/browser</code> or <code>routerconsole.browser=\\path\\to\\browser.exe</code> if using Windows, replacing <code>\\path\\to\\browser</code> with the location of the browser you wish to use. Note: If the path to your chosen browser contains spaces, you may need to encase the path in quotes e.g. <code>routerconsole.browser=\"C:\\Program Files\\Mozilla\\Firefox.exe\"</code>";
    t[11025] = "Po privzemu bo I2P uporabil privzeti brskalnik, nastavljen v sistemu, za zagon ob zagonu sistema. \u010ce \u017eelite predlagati alternativen brskalnik, boste morali urediti svojo datoteko router.config (ali pa <a href=/configadvanced>stran za napredno konfiguracijo</a>, \u010de ste omogo\u010dili napredni na\u010din konzole) in dodati novo konfiguracijsko vrstico <code>routerconsole.browser=/path/to/browser</code> ali <code>routerconsole.browser=\\path\\to\\browser.exe</code>, \u010de uporabljate Windows, zamenjajte <code>\\path\\to\\browser</code> s pot do brskalnika, ki ga \u017eelite uporabiti. Opomba: \u010ce pot do izbranega brskalnika vsebuje presledke, morda boste morali pot obklopiti z navodili, npr. <code>routerconsole.browser=\"C:\\Program Files\\Mozilla\\Firefox.exe\"</code>";
