    t[11658] = "Your modem or router may support <a href=https://wikipedia.org/wiki/Universal_Plug_and_Play target=_blank rel=noreferrer>Universal Plug &amp; Play</a> (UPnP), which permits automatic port forwarding. Ensure UPnP support for I2P+ is enabled on the <a href=/confignet>config page</a>, then try to activate UPnP on your modem/router and possibly your computer also. Now try restarting the <a href=/>I2P+ router</a>. If successful, I2P+ should report \"Status: OK\" in the side panel once the I2P+ router completes initial connectivity tests.";
    t[11659] = "Va\u0161 modem ali stre\u017enik morda podpira <a href=https://wikipedia.org/wiki/Universal_Plug_and_Play target=_blank rel=noreferrer>Univerzalno vstavitev &amp; uporabo</a> (UPnP), kar omogo\u010da samodejno usmerjanje vrata. Poskrbite, da je podpora UPnP za I2P+ omogo\u010dena na <a href=/confignet>strani za konfiguracijo</a>, nato poskusite aktivirati UPnP na va\u0161em modem/stre\u017eniku in morda tudi na va\u0161em ra\u010dunalniku. Zdaj poskusite ponovno zagnati <a href=/>stre\u017enik I2P+</a>. \u010ce je uspe\u0161no, bi I2P+ moral poro\u010dati \"Stanje: OK\" na vrstnici, ko je stre\u017enik I2P+ kon\u010dal za\u010detne preglede povezanosti.";
