    t[12026] = "I2P FAQ";
    t[12027] = "\u010cPP I2P";
    t[12028] = "If you hover over the <i>Router Info</i> heading, your truncated router identity will be shown (the first four characters (24 bits) of your 44-character (256-bit) Base64 router hash). The full hash is shown on your <a href='netdb?r=.'>Network Database entry</a>. Never reveal this to anyone, as your router identity is uniquely linked to your IP address in the network database.";
    t[12029] = "\u010ce premikate nad naslovom <i>Informacije o stre\u017eniku</i>, se bo prikazala skra\u0161ena identiteta stre\u017enika (prve \u010detiri znake (24 biti) va\u0161e 44 znakov (256 bitov) Base64 hash stre\u017enika). Poln hash je prikazan na va\u0161i <a href='netdb?r=.'>vstavi v bazo podatkov omre\u017eja</a>. To nikoli ne odkrijte nikomur, saj je identiteta va\u0161ega stre\u017enika edinstveno povezana z va\u0161o IP naslovom v bazi podatkov omre\u017eja.";
    t[12030] = "Previous";
