    t[12033] = "Ustavil usmerjevalnik";
    t[12038] = "Directory listings (sometimes referred to as virtual directories) are enabled by default, so you can host files from a sub-directory of <code>docroot</code> without providing a page with links to the files. You can also serve content that exists outside of <code>docroot</code> by using a <a href=https://en.wikipedia.org/wiki/Symbolic_link target=_blank rel=noreferrer class='sitelink external'>symbolic link</a> to the desired directory.";
    t[12039] = "Seznam mape (pogosto se omenja kot virtualne mape) je privzeto omogo\u010den, zato lahko gostite datoteke iz podmapi <code>docroot</code> brez ponudbe strani z povezavami do datotek. Tudi lahko gostite vsebino, ki obstaja zunaj <code>docroot</code> mape, tako da uporabite <a href=https://en.wikipedia.org/wiki/Symbolic_link target=_blank rel=noreferrer class='sitelink external'>simboli\u010dna povezava</a> do \u017eelene mape.";
